import React from 'react';
import './homepage.scss';

const HomePage = () => {
  return (
    <div className='homepage'>
        <div className='homepage-container'>
            <button>Create Exam</button>
            <button>Attend Exam</button>
            <button>Answer</button>
        </div>
    </div>
  )
}

export default HomePage
